	var color=feature.properties.NAME;
	if(color=='orange - rush +'){
		color='orange';
	}else if(color=='silver'){
		color='rgba(0,0,0,0.5)'
	}else if(color=='blue'){
		color='steelblue'
	}else if(color=='yellow'){
		color='rgb(255, 229, 0)'
	}
    return {
        weight: 2,
        opacity: 1,
        color: color,
        fillOpacity: 0.7
    };

		var popup = L.popup({ offset: L.point(0, 0) })
			  .setLatLng(circle.getLatLng())
			  .setContent("<div><span><strong>Station : </strong>"+d.Name+"</span>"+
			  "<br/><span><strong>Code : </strong>"+d.Code+"</span>"+" </div>");
		circle.bindPopup(popup);
		circle.on('mouseover',function(){
			circle.openPopup();
		});
		d3.selectAll('.'+d.LineCode1)
			.style('fill',function(){
				return colorize(d.LineCode1);
			})
			.style('fill-opacity','1');
	
	});
	
	function update() {
	  d3.selectAll(".circle")
		.attr("cx", function(d){ return map.latLngToLayerPoint([d.Lat, d.Lon]).x })
		.attr("cy", function(d){ return map.latLngToLayerPoint([d.Lat, d.Lon]).y })

	}

	map.on("moveend", update)
	setLegendGradient();
		setLegendScale();
	  function setLegendGradient() {
			
			var legendGradient =["rgba(102, 255, 0, 0)",
					"rgba(102, 255, 0, 1)",
					"rgba(147, 255, 0, 1)",
					"rgba(193, 255, 0, 1)",
					"rgba(238, 255, 0, 1)",
					"rgba(244, 227, 0, 1)",
					"rgba(249, 198, 0, 1)",
					"rgba(255, 170, 0, 1)",
					"rgba(255, 113, 0, 1)",
					"rgba(255, 57, 0, 1)",
					"rgba(255, 0, 0, 1)"];
			var gradientCss = '(left';
			for (var i = 0; i < legendGradient.length; ++i) {
				gradientCss += ', ' + legendGradient[i];
			}
			gradientCss += ')';
			
			$('#legendGradient').css('background', '-webkit-linear-gradient' + gradientCss);
			$('#legendGradient').css('background', '-moz-linear-gradient' + gradientCss);
			$('#legendGradient').css('background', '-o-linear-gradient' + gradientCss);
			$('#legendGradient').css('background', 'linear-gradient' + gradientCss);
		}
		function setLegendScale(){
			var key = d3.select("#legendGradient")
					  .append("svg")
					  .attr("width", '290px')
					  .attr("height", '30px');
			d3.select('#legendGradient').style('border','1px solid grey');
			var y = d3.scale.linear()
				  .range([5 , 285])
				  .domain([0,300]);

			var yAxis = d3.svg.axis().orient('bottom')
				  .scale(y)
				  .ticks(5);
			key.append("g")
				  .attr("class", "y axis")
				  .attr("transform", "translate(0,13)")
				  .call(yAxis)
				  .append("text")
				  .attr("transform", "rotate(-90)")
				  .attr("class", "scalelables")
				  .attr("y", 0)
				  .attr("dy", ".71em")
				  .style("text-anchor", "start");
		}
	
	</script>
</body>
</html>
